import React, { useState } from 'react'
import BookFinder from '../Apis/BookFinder'
import { useNavigate } from 'react-router-dom'

const AddBook = (props) => {

    const [forma, setForm] = useState("[]")
    const [errors, setErrors] = useState("[]")
    
    const setField = (field, value) => {
        setForm({
           ...forma,
           [field]:value 
        })

        if(!!errors[field]){
            setErrors({
                ...errors,
                [field]:null
            })
        }
    }

    const [isbn, setIsbn] = useState("")
    const [title, setTitle] = useState("")
    const [author, setAuthor] = useState("")
    const [year, setYear] = useState("")
    const [publisher, setPublisher] = useState("")
    const [language, setLanguage] = useState("")
    const [translation, setTranslation] = useState("")
    const [tags, setTags] = useState("")

    const navigate = useNavigate()

    const validateForm = () => {
        const {isbn, title, author, year, publisher, language, translation, tags} = forma
        const newErrors = {}

        if(!isbn || isbn === '') newErrors.isbn = 'pleas add ISBN'

        return newErrors
    } 

    const handleSubmit = async (e) => {
        e.preventDefault();
        const formErrors = validateForm()
        try{
            await BookFinder.post(`/`, {
                isbn,
                title,
                author,
                year,
                publisher,
                language,
            });
        } catch (err) {
            console.log(err);
        }
      navigate("/")
    };

    return (
        <div>
            <form action="">
                <div class="mb-3">
                    <label htmlFor="isbn">ISBN</label>
                    <input 
                    onChange={(e) => {setIsbn(e.target.value), setField('isbn', e.target.value)}} 
                    id="isbn" className="form-control" 
                    type="text" 
                    value={forma.isbn}
                    isInvalid={!!errors.isbn}
                    />
                    <div>{errors.isbn}</div>
                </div>

                <div class="mb-3">
                    <label htmlFor="title">Title</label>
                    <input value={title} onChange={(e) => setTitle(e.target.value)} id="title" className="form-control" type="text" required/>
                </div>
  
                <div class="mb-3">
                    <label htmlFor="author">Author</label>
                    <input value={author} onChange={(e) => setAuthor(e.target.value)} id="author" className="form-control" type="text" required/>
                </div>
          
                <div class="mb-3">
                    <label htmlFor="year">Year</label>
                    <input value={year} onChange={(e) => setYear(e.target.value)} id="year" className="form-control" type="text" required/>
                </div>

                <div class="mb-3">
                    <label htmlFor="publisher">Publisher</label>
                    <input value={publisher} onChange={(e) => setPublisher(e.target.value)} id="publisher" className="form-control" type="text" required/>
                </div>

                <div class="mb-3">
                    <label htmlFor="language">Language</label>
                    <input value={language} onChange={(e) => setLanguage(e.target.value)} id="language" className="form-control" type="text" required/>
                </div>

                <div class="mb-3">
                    <label htmlFor="translation">Translation</label>
                    <input value={translation} onChange={(e) => setTranslation(e.target.value)} id="translation" className="form-control" type="text" />
                </div>

                <div class="mb-3">
                    <label htmlFor="tags">Tags</label>
                    <input value={tags} onChange={(e) => setTags(e.target.value)} id="tags" className="form-control" type="text" />
                </div>
                <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                <button type="button" onClick={(e) => { e.stopPropagation(), navigate(`/`) } } className="btn btn-primary">Back</button>
                <button type="submit" onClick={handleSubmit} className="btn btn-success">Submit</button>
                </div>
            </form>
        </div>
    )
}

export default AddBook
